(54640, 116418, 5119, 10, '【不對盤】 詞／曲：方晴君　歌：大牛', '不對盤－方晴君 \n唱片：棉花糖精神(貳)－＜不合＞系列\n作詞者：方晴君\n作曲者：方晴君\n製作人：無\n次類型：Indie Rock\n音樂類型：Alternative\n發行日期：2011-07-10 \n廠牌：棉花糖精神', '2013-10-02 00:00:00', 2011, 0, 1, 7, '【不對盤】 詞／曲：方晴君　歌：大牛\n\nA1\n這氣氛看樣子太過不好　有對手在路中擋道　\n機車的雙眼　偷窺的感覺將我緊緊圍繞\n\nA2\n有陰謀論正在慢慢發酵　伺機要我一次就倒　\n卻不能逃跑　也不想懦弱　～的跪地求饒\n\nC1\n我們早就已經天生不對盤\n知己知彼成為得勝的姿態\n比誰有霸氣能力　比誰有能耐\n　用心計較　看誰擺陣擺的最精采\n\nC2\n我們早就已經天生不對盤\n要玩什麼把戲我都會看穿\n比誰有心機　比誰有手段\n　每天上演諜對諜的戲碼　找答案\n', '', 212, '', '方晴君', '方晴君', '大牛', '棉花糖精神', '', 0, 1, 0, '2012-10-01 22:06:30', '2015-03-12 13:56:09', '0000-00-00 00:00:00'),
