(54824, 133, 5115, 4, '溶話', '', '2012-10-10 00:00:00', 2000, 20, 0, 4, '', '把我們說過的話 藏在棉被底\n睡著是你 夢是你\n睡醒是你 什麼也 是你\n平面讓我們陷入膠著 何況是立體\n\n摸摸螢幕上你的名字 都叫我心跳加速\n我記得一些忘記一些 都令我心滿意足\n爆米花一把抓起來 挺像一團泡泡紙\n好想親吻你 臉上引誘我 發餓的牙齒\n\n擁有你如此奢侈 擁抱你我毫無力氣\n你是又重又看不清內容的金色玻璃瓶\n折射的反光停滯 映著你我眼闔不起\n\n你餵我喝進一口水 噓 別說了\n你的唇貼緊我的唇 我們 別了\n\n把我們說過的話溶進沐浴精\n加水攪和用力洗我們的心虛', 313, '', '', '', '', '', '', 0, 1, 0, '2012-10-02 17:59:58', '2015-03-12 13:56:15', '0000-00-00 00:00:00'),
