(54831, 116418, 5119, 14, '【Dearest Friend】 詞：凱琳　曲：方晴君　　歌：大牛', 'Dearest Friend　\n唱片：棉花糖(三)－＜時光隧道＞系列\n作詞者：楊凱琳\n作曲者：方晴君\n次類型：Indie Rock\n音樂類型：Alternative\n發行日期：2011-08-10 \n廠牌：棉花糖精神', '2013-10-01 00:00:00', 2011, 0, 1, 7, '【Dearest Friend】 詞：凱琳　曲：方晴君　　歌：大牛\n　　　　　　　　　\nA1\n電話那端的你很興奮告訴我  你暪著爸媽買了一台紅色125\n你說要載我看電影和兜風  我們約在一個星期六的　夏日午后\n\nA2\n那天終於來臨 卻沒看到你  嗶嗶叩裡也沒有你的留言訊息\n眼前突然出現你 很拉風的迎向我 \n可是你才一出現 卻又消失無蹤\n\nBRIDGE:\n聖誕夜裡同學說你　永遠都不會來了 \n初冬夜晚的一場車禍中 你離開了\n我的笑凝結在瞬間　淚也停止不得\n我問自已你走了 我該怎麼辦呢 \n\nC1\n我們的夢想呢 我們的未來呢  我們的過去呢 我們的回憶呢\n你不帶一點走嗎　我無力一個人　去承擔　這些那麼多\n\nC2\n你都要走了 我們約定還記著你都要走了 電影票己買好了\n你都要走了 還放不下我\n你好壞 你不乖    你明知道我怕孤單　怕寂寞 \n', '', 290, '', '方晴君', '凱琳', '大牛', '棉花糖精神', '', 0, 1, 0, '2012-10-02 22:04:28', '2015-03-12 13:56:15', '0000-00-00 00:00:00'),
(54832, 116418, 5119, 11, '【悲傷識別】　詞：大貓　　曲：方晴君　歌：大牛', '悲傷識別－蘇亦柔 \n唱片：棉花糖(三)－＜時光隧道＞系列\n作詞者：蘇亦柔\n作曲者：方晴君\n次類型：Indie Rock\n音樂類型：Alternative\n發行日期：2011-08-10 \n廠牌：棉花糖精神\n', '2013-10-01 00:00:00', 2011, 0, 1, 7, '【悲傷識別】　詞：大貓　　曲：方晴君　歌：大牛\n\n你好嗎？　我很好．．只是有點想你\n你真的好嗎？　我還算很好　\n真的只有一點點 想你．\n\n\nA1　\n亮白色的月　 打結在頂樓的天線\n快冷掉的咖啡　呼應蹲在牆角的虛偽\n\n影子追逐著賊　在孤單裡　表演甩尾\n而我在心被偷走的那一頁\n　～一邊寫　一邊流淚…\n\n\nC1\n烏雲　一片片　風吹　就忽略\n落淚　穿雨鞋　反正沒人知道我是誰\n\n收起　舊照片　微笑　就告解\n無聊　夜看雲飛　別讓悲傷識別...\n', '', 248, '', '方晴君', '蘇亦柔', '大牛', '棉花糖精神', '', 0, 1, 0, '2012-10-02 22:12:19', '2015-03-12 13:56:15', '0000-00-00 00:00:00'),
(54833, 116418, 5119, 9, '【布娃娃】　詞／曲／歌：方晴君', '布娃娃－方晴君 -1\n唱片：棉花糖(三)－＜時光隧道＞系列\n作詞者：方晴君\n作曲者：方晴君\n次類型：Indie Rock\n音樂類型：Alternative\n發行日期：2011-08-10 \n廠牌：棉花糖精神\n\n\n\n每個小女生，小時候，一定都有洋娃娃陪伴童年！我的熊熊，陪了我二十幾年有餘，就算新娃娃一直出現，我還是就只愛他，他不是人人鍾愛穿著華麗衣裝的芭比娃娃，他是一隻無尾熊…所以鼻子很大，我記得常常掉下來，我再用快乾黏回去，都不知幾多次了…我愛他愛到己經把他放在我的未來人生的規劃裡了，我想他會陪我長大．陪我出嫁．陪我當媽媽．陪我的兒女．．直到哪一天我走了陪我下葬...在1997年的七月末日也就是我生日的那一天，我的背包裡裝著他，因為我們生不能在一起，死也要死在一起，一起在那天等死…可是預言不準，後來又有閏八月，我總是會準備一個包包把他揹在我身上…一起共赴黃泉，就可以知道我有多愛熊熊了。\n\n結果９２１地震發生，住在外頭的帳篷，熊熊就在中秋節時，他不見了…那一陣子，家裡的人都怕我想不開尋死，我也用盡我書中看到的小魔法去找他，但是…就是找不到！其實它己經好髒了…可能我怎麼也沒想到，他有一天會不見，但一次夢裡，他跟我說他去救人了……我只好相信，那是真的，可是心好酸…看這詞我心裡好酸！事發如今，我還是希望有一天…它還會再回來我身邊！\n	\n', '2012-10-02 00:00:00', 2011, 0, 1, 7, '【布娃娃】　詞／曲／歌：方晴君\n\nA1\n打我出生的那一刻　 \n熊熊你就己經在我身邊\n守護我的笑臉　陪我夜夜安睡 \n　不知不覺　過了二十幾年\nA2\n漸漸我己經越長越大　 \n熊熊你卻變的越來越髒　\n～但我總那麼想　\n　有天你會　陪著我一起出嫁\n\nbridge:\n你是我的小寶貝　\n沒有你我不能入睡　\n抱著你哪怕　心事沒人了解\n\nＣ１\n卻在那一年的月圓時候 \n你突然消失　我的心失魂落魄\n我心急如焚　我心如刀割　\n　像發了瘋還跑去求神問佛\n\nＣ２\n是不是上天眼紅你和我　\n感情好過就像知心朋友\n我真的好懷念　你陪伴我的歲月　\n哪怕在這一生　只能相遇在夢裡　我的熊熊！', '', 260, '', '方晴君', '方晴君', '大牛', '棉花糖精神', '', 0, 1, 0, '2012-10-02 22:19:19', '2015-03-12 13:56:15', '0000-00-00 00:00:00'),
(54834, 116418, 5119, 17, '【想變成風】　詞／曲：方晴君　歌：大牛', '唱片：棉花糖精神(四)－＜曲速125＞系列\n作詞者：方晴君\n作曲者：方晴君\n次類型：Indie Rock\n音樂類型：Alternative\n發行日期：2011-09-10 \n廠牌：棉花糖精神\n\n我的心中住著武俠世界和城堡裡的公主…我的心總是矛盾在這兩個境界裡…我熱愛武俠，但不是單單誰的作品…\n我最喜歡有二十年前的＜霹靂神捕會京師＞改編作品，原本是四個男的，改編之後，變成２男２女…一般電視劇，就會變成愛情片…\n我喜歡飾演追命的雪梨，小時候最常做的事就是拿著掃把當長劍…一副嫉惡如仇的樣子…只是當時的我，很傻很天真．．真的以為長大就會變成俠女…\n\n這原本是我十六七歲畫的稿子　＜想變成風＞\n', '2013-10-01 00:00:00', 2011, 0, 1, 7, '【想變成風】　詞／曲：方晴君　歌：大牛\n\nA1\n請不要問我從哪裡來\n請不要忘了那己離去的背影\n請不要觸碰我的舊日傷口   請不要制止我～\n\nA2\n請不要問我何時會回來\n請不要在窗口 前面 等我\n妳說我總是自由像風　說來就來　說走就走　\n\nBRIDGE:\n我一生情深只因妳\n伴妳情愛相隨不分離\n不要責備我　總是　雲淡風輕\n不要哭泣生命中　最鍾愛的妳\n\nC1\n想變成風  我發誓 用生命 守護妳\n想變成風　只要緊緊擁妳 在懷裡\n\nC2\n想變成風　化成 生命中的夢　跟著妳\n想變成風  在滿心愛意裡　呼喚妳的名 \n', '', 184, '', '方晴君', '方晴君', '大牛', '棉花糖精神', '', 0, 1, 0, '2012-10-02 22:28:59', '2015-03-12 13:56:15', '0000-00-00 00:00:00'),
(54835, 91296, 0, 1, '大笑三聲', '不要計仇 該往好的地方看 大笑三聲甚麼事都可以遺忘', '2012-10-02 00:00:00', 2000, 0, 2, 7, '我留在小房間裡 低頭 (不是他的房間) \r\n\r\n懷疑著自己的存在 還好嗎 (不是他的世界)\r\n\r\n你別再把我逼瘋 我快要不行 真的 \r\n\r\n我快要爆發 真的真的.... 學習著一切 喔喔喔\r\n\r\n每個人心中都有惡 但看起來面面心善\r\n\r\n那是他努力裝出來的 越客氣的人越不懷好心眼\r\n\r\n但是那也沒關西 我們不需去批評 \r\n\r\n因為我們自己也好不到哪去\r\n\r\n我大笑著三聲 看見了世界\r\n\r\n我遺忘著  跌入谷底的滋味\r\n\r\n我相信著 總會有好的人\r\n\r\n我大笑著三聲  笑著藏著些甚麼', '', 152, '', '桃利煬', '桃利煬', '桃利煬', '', '', 0, 0, 1, '2012-10-02 23:27:14', '2013-10-07 17:22:44', '0000-00-00 00:00:00'),
