(54837, 153306, 0, 1, 'Smoking Ring 煙圈(demo)', '', '2012-10-03 00:00:00', 2000, 0, 1, 7, '看不見的 是迷幻是惶恐 我擁有的 是遺忘是中空\r\n貪婪的 幻想的 忌妒的 爭奪者 \r\n得意的 中庸的 空虛的 虛偽者\r\n\r\nIt''s hard to know , There is something in the wall\r\nBut no one knows how , To show up with their mind\r\nAnd if you afraid of finding another way to go \r\nOh freedom is not standing there and waiting for you.', '', 196, '', '', '', '', '', '', 1, 1, 0, '2012-10-03 01:32:54', '2015-03-12 13:56:15', '0000-00-00 00:00:00'),
